import React, { Component } from 'react';
import {getItemList} from '../../redux/high-order-component/getListAction'

import {connect} from 'react-redux'


class Posts extends Component {

    state = {
        reducer: 'POSTS',
    }

    componentDidMount(){
        this.props.getItemList(this.state.reducer)
    }

    render() {
        return (
        <div className="Posts">

        </div>
        );
  }
}


const mapStateToProps = (state) => {

  return {
      isFetching: state.library.posts.isFetching,
      listposts: state.library.posts.list,

  }
}


export default connect(mapStateToProps, { getItemList })(App);
